[init]
{
100 25 5 5
}

[node]
{
/sys/kernel/debug/interrupts,interrupt-log
/sys/kernel/debug/suspend_stats,suspendstats-log
/sys/kernel/debug/wakeup_sources,wakeupsources-log
/sys/kernel/debug/rpm_master_stats,master_stats-log
/sys/kernel/debug/rpm_stats,rpmstats-log
}

[dumpsys]
{
dumpsys alarm,alarm
dumpsys cpuinfo,cpuinfo
dumpsys power,power
}

[cmd]
{
echo 1 > /sys/kernel/debug/clk/debug_suspend
}

[nv]
{
114 10 543 60000 60001 60002 453
}

